import React from "react";

const VideoList = ({ videos }) => {
  if (videos.length === 0) return <p>No video yet.</p>;
  return (
    <ul className="list-group">
      {videos.map((video, index) => (
        <li key={index} className="list-group-item">
          {video}
        </li>
      ))}
    </ul>
  );
};

export default VideoList;
